    < div className = "col-md-4 offset-md-1" >
      < h2 > Artikel < / h2 >
      <List articles={[1,2,3]}/>
    < / div >
    < div className = "col-md-4 offset-md-1" >
      < h2 > Tambahkan artikel baru < / h2 >
     <Form />
        
    < / div >
  < / div >
  );
}

